import React, { Component } from 'react';

class WalletForm extends Component {
  render() {
    return (
      <fieldset>
        <label htmlFor="despesa">
          <input
            data-testid="value-input"
            type="button"
            id="despesa"
            name="despesa"
          />
        </label>

        <button
          type="submit"
        >
          Adicionar Despesa
        </button>
      </fieldset>
    );
  }
}

export default WalletForm;
